import Typewriter from 'typewriter-effect';

export default function Landing(props) {
    return (
        <div className="auth-parent" onKeyPress={() => {console.log("hi")}}>
            <div className="panel">
                <div className="paneltext">
                <Typewriter
                    options={{
                        autoStart: true,
                        delay: 50,
                    }}
                    onInit={(typewriter) => {
                        typewriter.typeString('William Toth OS')
                            .pauseFor(700)
                            .typeString("\nCopyright (c) 2022")
                            .pauseFor(700)
                            .typeString("\nAll Rights Reserved")
                            .pauseFor(700)
                            .typeString("\nRelease Version 1.0")
                            .pauseFor(700)
                            .typeString("\nPress any key")
                            .start();
                      }}
                />
                </div>
            </div>
        </div>
    )
}
